import React from "react";
import Post from "./Post";
import './Posts.css';
function Posts({posts}) {

  console.log(posts)
  return (
    <div className="post-flex">
      <div>
        <h1>Posts</h1>
        <hr />
      </div>
      <div className="posts">
        {posts.length == 0 ? (
          <div>
            <p>No Users selected</p>
          </div>
        ) : (
          <div>
            {posts.map((post)=>(
              <Post post={post} key={post.id}/>
            ))}
          </div>
        )}
      </div>
    </div>
  );
}

export default Posts;
